import React, { Component } from 'react'

export class Filter extends Component {
  render() {
    return (
      <div>
        <span> Count </span>
        <button > All </button>
        <button style="display:inline-block" > Active </button>
        <button style="display:inline-block" > Completed </button>
      </div>
    )
  }
}

export default Filter
